use crate::tensor::Tensor;

// get (row) vectors from a 2D table given a list of indices
pub fn gather(y: &mut Tensor<f32>, indices: &Tensor<u32>, table: &Tensor<f32>) {
    let length = indices.size();
    let table_shape = table.shape();
    assert!(table_shape.len() == 2);
    let dim = table_shape[1];
    assert!(y.size() == length * dim);
    for i in 0..length {
        let src = &table.data()[indices.data()[i] as usize * dim..][..dim];
        let dst = &mut unsafe { y.data_mut() }[i * dim..][..dim];
        dst.copy_from_slice(src);
    }
}

// RoPE: Rotary Positional Embedding
pub fn rope(y: &mut Tensor<f32>, start_pos: usize, theta: f32) {
    let shape = y.shape();
    assert!(shape.len() == 3);
    let seq_len = shape[0];
    let n_heads = shape[1];
    let d = shape[2];
    let data = unsafe { y.data_mut() };
    for tok in 0..seq_len {
        let pos = start_pos + tok;
        for head in 0..n_heads {
            for i in 0..d / 2 {
                let a = data[tok * n_heads * d + head * d + i];
                let b = data[tok * n_heads * d + head * d + i + d / 2];
                let freq = pos as f32 / theta.powf((i * 2) as f32 / d as f32);
                let (sin, cos) = freq.sin_cos();
                data[tok * n_heads * d + head * d + i] = a * cos - b * sin;
                data[tok * n_heads * d + head * d + i + d / 2] = b * cos + a * sin;
            }
        }
    }
}

// softmax(x) = exp(x - max) / sum(exp(x - max))
// y = softmax(mask(x))
pub fn masked_softmax(y: &mut Tensor<f32>) {
    let ndim = y.shape().len();
    assert!(ndim >= 2);
    let seq_len = y.shape()[ndim - 2];
    let total_seq_len = y.shape()[ndim - 1];
    let batch = y.size() / (seq_len * total_seq_len);
    let data = unsafe { y.data_mut() };
    for b in 0..batch {
        let base = b * seq_len * total_seq_len;
        for i in 0..seq_len {
            let offset = base + i * total_seq_len;
            let boundary = total_seq_len - seq_len + i + 1;

            let max = data[offset..offset + boundary]
                .iter()
                .fold(data[offset], |a, b| a.max(*b));

            let sum = (0..boundary)
                .map(|j| {
                    let e = (data[offset + j] - max).exp();
                    data[offset + j] = e;
                    e
                })
                .sum::<f32>();

            (0..boundary).for_each(|j| data[offset + j] /= sum);
            (boundary..total_seq_len).for_each(|j| data[offset + j] = 0.0);
        }
    }
}

//yi = w * xi / sqrt(1/n * sum_by_j(xij^2)+ e)
pub fn rms_norm(y: &mut Tensor<f32>, x: &Tensor<f32>, w: &Tensor<f32>, epsilon: f32) {
    //x,y是2维矩阵，w是向量
    assert!(y.shape().len() == 2);
    let num_token = y.shape()[0];
    let token_dim = y.shape()[1];
    //assert!(token_dim == x.shape()[1]);
    assert!(token_dim == w.size());
    //assert!(num_token == x.shape()[0]);

    let _y = unsafe { y.data_mut() };
    let _x = x.data();
    let _w = w.data();

    for i in 0..num_token{
        let mut sum:f32 = 0.0;
        for j in 0..token_dim{
            _y[i*token_dim+j] = _w[j] * _x[i*token_dim+j];
            sum += _x[i*token_dim+j] * _x[i*token_dim+j];
        }
        for j in  0..token_dim{
            _y[i*token_dim+j] = _y[i*token_dim+j] / (1.0/(token_dim as f32) * sum +epsilon).sqrt();
        }

    }
}

// y = sigmoid(x) * x * y
// hint: this is an element-wise operation
pub fn silu(y: &mut Tensor<f32>, x: &Tensor<f32>) {
    let len = y.size();
    assert!(len == x.size());

    let _y = unsafe { y.data_mut() };
    let _x = x.data();

    for i in 0..len {
        let sigmoid = 1.0 / (1.0 + (-_x[i]).exp()); // 计算 sigmoid
        _y[i] = _x[i] * sigmoid * _y[i]; // 计算 silu
        //println!("{}",i);
    }
}

// C = beta * C + alpha * A @ B^T
// hint: You don't need to do an explicit transpose of B
pub fn matmul_transb(c: &mut Tensor<f32>, beta: f32, a: &Tensor<f32>, b: &Tensor<f32>, alpha: f32) {
    assert!(c.shape().len() == 2); // TODO: only support two-dimensional matrix
    assert!(a.shape().len() == 2);
    assert!(b.shape().len() == 2);
    let y_num = c.shape()[1];
    let x_num = c.shape()[0];
    let k_num = a.shape()[1];
    //(x_num,k_num) x (y_num,k_num) before transpose => (x_num,y_num)

    let _a = a.data();
    let _b = b.data();
    let _c = unsafe { c.data_mut() };

    for x in 0..x_num {
        for y in 0..y_num {
            let mut sum =0.0;
            for k in 0..k_num{
                sum+=_a[x*k_num+k]*_b[y*k_num+k];
                //println!("a[{}][{}]= {}",x,k,_a[x*k_num+k]);
                //println!("a[{}][{}]= {}",x,k,_b[y*k_num+k]);
                //println!("a[{}][{}]*b[{}][{}]={} and sum is {}",x,k,y,k,_a[x*k_num+k]*_b[y*k_num+k],sum);
            }
            sum=sum*alpha;
            _c[x*y_num+y]=sum+beta*_c[x*y_num+y];
            //println!("c[{}][{}]={}",x,y,_c[x*y_num+y]);
        }
    }
}

pub fn matmul(c: &mut Tensor<f32>, a: &Tensor<f32>, b: &Tensor<f32>){
    assert!(c.shape().len() == 2); // TODO: only support two-dimensional matrix
    assert!(a.shape().len() == 2);
    assert!(b.shape().len() == 2);
    let x_num = c.shape()[0];
    let y_num = c.shape()[1];
    let k_num = a.shape()[1];
    let _c = unsafe { c.data_mut() };
    let _a = a.data();
    let _b= b.data();

    for x in 0..x_num{
        for y in 0..y_num{
            _c[x*y_num+y] = 0.0;
            for k in 0..k_num{
                _c[x*y_num+y]+=_a[x*k_num+k]*_b[k*y_num+y];
            }
        }
    }
}

// Dot product of two tensors (treated as vectors)
#[allow(unused)]
pub fn dot(x: &Tensor<f32>, y: &Tensor<f32>) -> f32 {
    let len = x.size();
    assert!(len == y.size());
    let x_ = x.data();
    let y_ = y.data();
    let mut sum = 0.0;
    for i in 0..len {
        sum += x_[i] * y_[i];
    }
    sum
}

// Sample a index from a tensor (treated as a probability vector)
pub fn random_sample(x: &Tensor<f32>, top_p: f32, top_k: u32, temperature: f32) -> u32 {
    assert!(x.shape()[x.shape().len() - 1] == x.size());
    if temperature <= 0. || top_k < 2 || top_p <= 0. {
        return x
            .data()
            .iter()
            .enumerate()
            .max_by(|(_, a), (_, b)| a.partial_cmp(b).unwrap())
            .unwrap()
            .0 as _;
    }

    #[derive(Clone, Copy, PartialEq, Debug)]
    struct Probability {
        val: f32,
        tok: u32,
    }
    impl Eq for Probability {}
    impl PartialOrd for Probability {
        #[inline]
        fn partial_cmp(&self, other: &Self) -> Option<std::cmp::Ordering> {
            Some(self.cmp(other))
        }
    }
    impl Ord for Probability {
        #[inline]
        fn cmp(&self, other: &Self) -> std::cmp::Ordering {
            match self.val.total_cmp(&other.val) {
                std::cmp::Ordering::Equal => self.tok.cmp(&other.tok),
                ord => ord.reverse(),
            }
        }
    }
    impl From<(usize, &f32)> for Probability {
        #[inline]
        fn from((i, p): (usize, &f32)) -> Self {
            Self {
                val: p.clone(),
                tok: i as _,
            }
        }
    }

    // sort
    let mut logits = x
        .data()
        .iter()
        .enumerate()
        .map(Probability::from)
        .collect::<Vec<_>>();
    logits.sort_unstable();
    let max = core::mem::replace(&mut logits[0].val, 1.);
    // softmax & sum
    for i in 1..logits.len() {
        logits[i].val = logits[i - 1].val + ((logits[i].val - max) / temperature).exp();
    }
    // topk & topp & random
    let pk = logits[(top_k as usize).min(logits.len()) - 1].val;
    let pp = logits[logits.len() - 1].val * top_p;
    let plimit = rand::random::<f32>() * f32::min(pk, pp);
    // sample
    logits.iter().find(|p| p.val >= plimit).unwrap().tok
}

