#[test]
fn test_matmul(){
    let mut c = Tensor::<f32>::new(vec![0., 0., 0., 0.], &vec![2, 2]);
    let a = Tensor::<f32>::new(vec![1., 2., 3., 4., 5., 6.], &vec![2, 3]);
    let b = Tensor::<f32>::new(vec![1., 2., 3., 4., 5., 6.], &vec![3, 2]);
    matmul(&mut c, &a, &b);
    c.print();

    let expected = Tensor::<f32>::new(vec![22., 28., 49., 64.], &vec![2, 2]);
    assert!(c.close_to(&expected,1e-3));
}
